function moveInner(n,t,i){while(t<0)t+=n.length;while(i<0)i+=n.length;if(i>=n.length)for(var r=i-n.length;r--+1;)n.push(undefined);return n.splice(i,0,n.splice(t,1)[0]),n}$(document).ready(function(){$(window).scroll(function(){$(this).scrollTop()>50?$("#back-to-top").fadeIn():$("#back-to-top").fadeOut()});$("#back-to-top").click(function(){return $("#back-to-top").tooltip("hide"),$("body,html").animate({scrollTop:0},800),!1});$("#back-to-top").tooltip("show")});var move=function(n,t,i){moveInner(n,t,t+i)};